import {
   useEffect
 } from 'react';
import $ from 'jquery';
import {
  Button,
  Container,
  Card
} from "react-bootstrap";
 const Http = ()=>{
   const[data,setData] = useState([]);
   const fetchData = ()=>{
     $.ajax({
       type: 'GET',
       url: 'http://localhost:3232',
       success: function(response){
         return setData(response);
       }
     });
   }
   useEffect(()=>{
     fetchData();
   });


  const design = (
    <>
    <Container className="py-4">
      <div className='d-flex justify-content-between mb-4'>
      {
        data.map((item)=>{
          console.log(item);
        })
      }
        <div>
          <h2>Comments</h2>
        </div>
        <div>
          <Button variant='success'>New Comment</Button>
        </div>
      </div>
      // <Card>
      //   <Card.Header>{data.title}</Card.Header>
      //   <Card.Body>
      //     <p>{data.body}</p>
      //   </Card.Body>
      // </Card>
    </Container>
    </>
  );
  return design;
}

export default Http;
